def validPalindrome( s:str):
    #st=s[0]
    rev=s[::-1]
    lenrev=len(rev)
    for i in range(lenrev):
        if s[0:i]+s[i+1:]==rev[0:lenrev-i-1]+rev[lenrev-i:]:
            return True
    return False
